import React from "react";
import "../Css/Navbar.css";
import logo from "../Images/logo.png";
import person from "../Images/person.svg";
import { NavLink, withRouter } from "react-router-dom";

const Navbar = ({ location }) => {
    return (
        <header>
            <div className="container container-flex">
                <div className="logo">
                    <img src={logo} alt="logo" className="logo" />
                </div>
                <nav>
                    <div className="list">
                        <CustomNavLink to="/" label="Home" currentPath={location.pathname} />
                        <CustomNavLink to="/author" label="Your Songs" currentPath={location.pathname} />
                        <CustomNavLink to="/playlist" label="Playlist" currentPath={location.pathname} />
                        <CustomNavLink to="/subs" label="Subscription" currentPath={location.pathname} />
                    </div>
                </nav>

                <div className="icon">
                    <img src={person} alt="person" className="person" />
                </div>
            </div>
        </header>
    );
}

const CustomNavLink = ({ to, label, currentPath }) => {
    const isActive = to === currentPath;
    return (
        <NavLink to={to} className={`listItem ${isActive ? "active-link" : ""}`}>
            {label}
        </NavLink>
    );
}

export default withRouter(Navbar);
